import React from 'react';
import Card from './Card';




const Cardlist = ({ friends }) => {

    const cardComponent = friends.map((user, i) => {
        return <
            Card key = { i }
        id = { friends[i].id }
        name = { friends[i].name }
        username = { friends[i].username }
        email = { friends[1].email }
        / >

    })
    return ( <
        div > { cardComponent } <
        /div>
    );
}

export default Cardlist
